import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Login from './Pages/Login';
import Footer from './components/Footer'; // só testando a renderização
import SearchBar from './components/SearchBar'
import './App.css';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Login />
        <Footer />
        <SearchBar />
      </BrowserRouter>
    </div>
  );
}

export default App;
